import { Arc3, IPFS } from 'arcraft';
import { useState } from 'react';

function NFTCreator() {
  const [file, setFile] = useState<File | null>(null);
  
  const ipfs = new IPFS('pinata', {
    provider: 'pinata',
    jwt: import.meta.env.VITE_PINATA_JWT_TOKEN,
  });

  const handleFileUpload = (event: React.ChangeEvent<HTMLInputElement>) => {
    const selectedFile = event.target.files?.[0];
    if (selectedFile) setFile(selectedFile);
  };

  const createNFT = async () => {
    if (!file) return;
    
    // Upload from File object (Browser specific)
    const result = await Arc3.create({
      name: 'Web NFT',
      unitName: 'WNFT',
      creator,
      ipfs,
      image: { file, name: file.name },
      properties: { 
        description: 'Created in web browser',
        environment: 'browser'
      },
      network: 'testnet',
    });
    
    console.log('NFT created:', result.assetId);
  };

  return (
    <div>
      <input type="file" onChange={handleFileUpload} accept="image/*" />
      <button onClick={createNFT}>Create NFT</button>
    </div>
  );
}`})})]}),jsxRuntimeExports.jsxs("div",{children:[jsxRuntimeExports.jsx("h4",{className:"text-lg font-semibold text-gray-900 mb-3",children:"React Native Mobile App"}),jsxRuntimeExports.jsx("pre",{className:"bg-gray-900 text-gray-100 rounded-lg p-4 overflow-x-auto",children:jsxRuntimeExports.jsx("code",{children:`// React Native mobile app example
